tables.table_schema:
CREATE TABLE financial_data (
  date DATE,
  stock_symbol VARCHAR(10),
  closing_price DECIMAL(10, 2),
  volume INT
);

CREATE TABLE forecasts (
  date DATE,
  stock_symbol VARCHAR(10),
  predicted_closing_price DECIMAL(10, 2),
  confidence_level DECIMAL(5, 2)
);

CREATE TABLE financial_data (
  id SERIAL PRIMARY KEY,
  date DATE NOT NULL,
  revenue DECIMAL NOT NULL,
  expenses DECIMAL NOT NULL
);

CREATE TABLE performance_metrics (
  id SERIAL PRIMARY KEY,
  date DATE NOT NULL,
  profit_margin DECIMAL NOT NULL,
  liquidity_ratio DECIMAL NOT NULL
);

CREATE TABLE forecasting_data (
  id SERIAL PRIMARY KEY,
  date DATE NOT NULL,
  sales_forecast DECIMAL NOT NULL,
  expenses_forecast DECIMAL NOT NULL
);
